import React from 'react';
import { Container } from './style';

const Home: React.FC = () => {
  return(
    <Container>
      <section>
        <div>
          <img src="https://cdn.pixabay.com/photo/2017/01/31/19/20/book-2026628__340.png" alt="Guitare" />
          <span>Name</span>
          <h6>Price</h6>
        </div>
      </section>
    </Container>
  )
}

export default Home;
